const image3 = new Image();
image3.src='data:image/png;base64,';


image3.addEventListener('load', function(){
    const canvas3 = document.getElementById('canvas3');
    const ctx3 = canvas3.getContext('2d');
    canvas3.width = 320;
    canvas3.height = 453;

    let particlesArray = [];
    const numberOfParticles = 4000;
    const detail = 1;

    ctx3.drawImage(image3, 0, 0, canvas3.width, canvas3.height);
    const pixels = ctx3.getImageData(0, 0, canvas3.width, canvas3.height);
    ctx3.clearRect(0, 0, canvas3.width, canvas3.height);

    let grid = [];
    for (let y = 0; y < canvas3.height; y += detail){
        let row = [];
        for (let x = 0; x < canvas3.width; x += detail){
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)]
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)]
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)]
            const color = 'rgb(' + red +',' + green + ',' + blue + ')';
            const brightness = calculateBrightness(red, green, blue)/100;
            const cell = [
                cellColor = color,
                cellBrightness = brightness,
            ];
            row.push(cell);
        }  
        grid.push(row); 
    }
    console.log(grid);
    class Particle {
        constructor(){
            this.x = Math.random() * canvas3.width;
            this.y = canvas3.height;
            //this.prevX = this.x;
            this.speed = 0;
            this.velocity = Math.random() * 2;
            this.size = Math.random() * 2 + 0.5;
            this.position1 = Math.floor(this.y / detail);
            this.position2 = Math.floor(this.x / detail);
            this.angle = 0;
        }
        update () {
            this.position1 = Math.floor(this.y / detail);
            this.position2 = Math.floor(this.x / detail);
            if (grid[this.position1]){
                if (grid[this.position1][this.position2]){
                    this.speed = grid[this.position1][this.position2][1];
                }
            }
            this.angle += this.speed/20;
            let movement = (2.5 - this.speed) + this.velocity;
            this.y -= movement + Math.cos(this.angle) * 2;
            this.x += Math.cos(this.angle) * 2;
            if (this.y <= 0) {
                this.y = canvas3.height;
                this.x = Math.random() * canvas3.width;
            }
            //console.log(this.x += movement)
        }
        draw(){
            ctx3.beginPath();
            ctx3.fillStyle = 'black';
            if (this.y > canvas3.height - this.size * 6) ctx3.globalAlpha = 0;
            if (grid[this.position1]){
                if (grid[this.position1][this.position2]){
                    ctx3.fillStyle = grid[this.position1][this.position2][0];
                }

            } else {
                ctx3.fillStyle = 'white';
            }
            ctx3.arc(this.x, this.y, this.size, 0, 2 * Math.PI);
            ctx3.fill();

        }
    }

    function init(){
        for (let i = 0; i < numberOfParticles; i++){
            particlesArray.push(new Particle());
        }
    }
    init();

    function animate () {
        ctx3.globalAlpha = 0.05;
        ctx3.fillStyle = 'rgb(0, 0, 0)';
        ctx3.fillRect(0, 0, canvas3.width, canvas3.height);
        ctx3.globalAlpha = 0.2;
        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            ctx3.globalAlpha = particlesArray[i].speed * 0.3;
            particlesArray[i].draw();
        }
        requestAnimationFrame( animate );
    }
    animate();

    function calculateBrightness(red, green, blue){
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        );
    }

});